package com.hqvibrator.improve;public class HQVibratorImprove {    private int mVoltage;    private long[] mVibPattern;    public int getmVoltage() {        return mVoltage;    }    public void setmVoltage(int mVoltage) {        this.mVoltage = mVoltage;    }    public long[] getmVibPattern() {        return mVibPattern;    }    public void setmVibPattern(long[] mVibPattern) {        this.mVibPattern = mVibPattern;    }    public HQVibratorImprove() {    }    public HQVibratorImprove(int vol, long[] pattern){        mVoltage = vol;        mVibPattern = pattern;    }}